import React, { Component } from 'react';
import './Home.sass';
import {Grid, Paper, Typography} from '@material-ui/core';


class Home extends Component {

    render() {
        return (
            <div className={'Home-container'}>
                <Grid container spacing={24}>
                    <Grid lg={3}/>
                    <Grid item xs={12} lg={6}>
                        <Paper>
                            <Typography>
                                Hello
                            </Typography>
                        </Paper>
                    </Grid>
                    <Grid lg={3}/>
                    <Grid lg={3}/>
                    <Grid item xs={12} lg={6}>
                        <Paper>
                            <Typography>
                                Hello
                            </Typography>
                        </Paper>
                    </Grid>
                    <Grid lg={3}/>
                </Grid>
            </div>
        );
    }
}
export default Home;
